import React from 'react';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';

const Content = () => {
	return (
		<Container>
			<Grid container direction='row-reverse' justify='space-between' style='padding: 20'>
				<Grid item>some1</Grid>
				<Grid item>some2</Grid>
				<Grid item>some3</Grid>
			</Grid>
		</Container>
	);
};

export default Content;
